function ProtectedRoute(props) {
  // const { component: Component, rest } = props;

  return (
    <Route
      // {...rest}
      render={() => {
        if (localStorage.getItem("token")) {
          return <Route {...props} />;
        } else {
          return <Redirect to="/Signup" />;
